 */
import LinkList from "./LinkList";
export default class Iterator {
    constructor(it,endToken= null) {
        this._it = it;
        this._cacheSize = 10;
        this._queueCache = new LinkList();
        this._stackCache = new LinkList();
        this._endToken = endToken;
    }
    //是否有next
    hasNext(){
        return this._endToken || !!this.peek();
    }
    //放回一个
    //a->b->c->d
    //d->c->b->a
    putBack(){
        if(this._queueCache.getSize()>0){
            this._stackCache.addLast(this._queueCache.removeLast());
        }
    }
    //查看当前
    peek(){
        if(this._stackCache.getSize()>0){
            return this._stackCache.getLast();
        }
        const val = this.next();
        this.putBack();
        return val;
    }
    //获取下一个
    next(){
        let val = null;
        if(this._stackCache.getSize()>0){
            val = this._stackCache.removeLast();
        }else{
            val = this._it.next().value;
            if(val === undefined){
                let temp = this._endToken;
                this._endToken = null;
                return  temp;
            }
        }
        while (this._queueCache.getSize()>this._cacheSize-1){
            this._queueCache.removeFirst();
        }
        this._queueCache.addLast(val);
        return val;
    }
}

/**
 * @author chaohui jiang
 * @version:v1.1.0
 */
class Node {
    constructor(val,pre,next) {
        this.val = val;
        this.pre = pre || null;
        this.next = next || null;
    }
}
export default class LinkList {
    constructor() {
        this._head = this._tail = null;
        this._size = 0;
    }
    getSize(){return this._size;}
    isEmpty(){return this._size === 0;}
    addFirst(val){
        if(this._head === null){
            this._head = this._tail = new Node(val);
        }else{
            this._head.pre = new Node(val,null,this._head);
            this._head = this._head.pre;
        }
        this._size++;
    }
    addLast(val){
        if(this._tail==null){
            this._head = this._tail = new Node(val);
        }else{
            this._tail.next = new Node(val,this._tail,null)
            this._tail = this._tail.next;
        }
        this._size++;
    }
    removeFirst(){
        if(this.isEmpty()){throw new Error(`linklist is empty!`)}
        let delNode = this._head;
        this._head = this._head.next;
        delNode.next = null;
        if(this._head===null){
            this._tail = null;
        }else{
            this._head.pre = null;
        }
        this._size--;
        return delNode.val;

    }
    removeLast(){
        if(this.isEmpty()){throw new Error(`linklist is empty!`)}
        let delNode = this._tail;
        this._tail = this._tail.pre;
        delNode.pre = null;
        if(this._tail == null){
            this._head = null;
        }else{
            this._tail.next = null;
        }
        this._size--;
        return delNode.val;
    }
    getFirst(){
        if(this.isEmpty()){throw new Error(`linklist is empty!`)}
        return this._head.val;
    }
    getLast(){
        if(this.isEmpty()){throw new Error(`linklist is empty!`)}
        return this._tail.val;
    }
    toString(){
        let formatStr = [];
        let cur = this._head;
        while (cur){
            formatStr.push(cur.val);
            cur = cur.next;
        }
        return formatStr.join('->');
    }
}

